                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 3, 7)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 3, 8)} maxLength = "1" /> </td>
                </tr>
                <tr>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 0)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 1)} maxLength = "1" /> </td>
