                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 4)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 5)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 6)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 7)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 4, 8)} maxLength = "1" /> </td>
                </tr>
                  
                <tr>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 0)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 1)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 2)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 3)} maxLength = "1" /> </td>
