                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 6)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 7)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 5, 8)} maxLength = "1" /> </td>
                </tr>
                <tr>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 0)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 1)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 2)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 3)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 4)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 5)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 6)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 7)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 6, 8)} maxLength = "1" /> </td>
                </tr>
                  
                <tr>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 7, 0)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 7, 1)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 7, 2)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 7, 3)} maxLength = "1" /> </td>
