                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 7, 7)} maxLength = "1" /> </td>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 7, 8)} maxLength = "1" /> </td>
                </tr>
                <tr>
                <td> <input type = "text" onInput = {(ev) => this.handleInput(ev, 8, 0)} maxLength = "1" /> </td>
